const _hoisted_7 = /* @__PURE__ */ createStaticVNode('<h2 id="info" tabindex="-1"><a class="header-anchor" href="#info" aria-hidden="true">#</a> Info</h2><p><strong>Bio-Data</strong></p><ul><li>Class: Archer</li><li>True Name: Osakabehime</li><li>Gender: Female</li><li>Source: Japanese Folklore[1]</li><li>Region: Japan (Himeji Castle)</li><li>Alignment: Neutral Summer</li><li>Height: 158cm</li><li>Weight: 50.4kg or namely 50kg (I&#39;m losing weight although it&#39;s only about 0.6kg. I&#39;ve lost weight)</li></ul><p><strong>Meta</strong></p><ul><li>Character Creator: Higashide Y\u016Bichir\u014D</li><li>Character Designer: Moriyama Daisuke</li><li>Character Voice: Fukuen Misato</li><li>Major Appearances in Main Works: Fate/Grand Order</li></ul><h2 id="stats" tabindex="-1"><a class="header-anchor" href="#stats" aria-hidden="true">#</a> Stats</h2><table><thead><tr><th style="text-align:left;">Parameters</th><th style="text-align:center;">Values</th></tr></thead><tbody><tr><td style="text-align:left;">Strength</td><td style="text-align:center;">D</td></tr><tr><td style="text-align:left;">Constitution</td><td style="text-align:center;">E</td></tr><tr><td style="text-align:left;">Agility</td><td style="text-align:center;">B</td></tr><tr><td style="text-align:left;">Magical Power</td><td style="text-align:center;">A</td></tr><tr><td style="text-align:left;">Luck</td><td style="text-align:center;">A</td></tr><tr><td style="text-align:left;">Noble Phantasm</td><td style="text-align:center;">EX</td></tr></tbody></table><h2 id="class-skills" tabindex="-1"><a class="header-anchor" href="#class-skills" aria-hidden="true">#</a> Class Skills</h2><p><strong>Fortress Construction: [B]</strong></p><p>A variant skill of Territory Creation. Capitalizing on her experience as the guardian deity of Himeji Castle, she is able to construct a stronghold.<br> At B rank, it is capable of withstanding bombing.</p><p><strong>Magic Resistance: [B]</strong></p><p>Invalidates spells with a chant below three verses.<br> Even if one is targeted by High-Thaumaturgy and Greater Rituals, it is difficult for them to be wounded.</p><p><strong>Independent Action: [A]</strong></p><p>It is possible to act in the absence of a master.<br> She is able to reduce mana consumption through the manipulation of origami soldiers[2].</p><p><strong>Divinity: [C-]</strong></p><p>An indigenous fierce demon/god[1] who was enshrined as the patron landowner god (\u5730\u4E3B\u795E, Jinushigami)[3] of Himeji.<br> The rank has slightly decreased due to being away from Japan.</p><h2 id="personal-skills" tabindex="-1"><a class="header-anchor" href="#personal-skills" aria-hidden="true">#</a> Personal Skills</h2><p><strong>Marksmanship (FPS): [B]</strong></p><p>The reflexes developed from in-game roar to life.<br> She moves left and right to avoid attacks, though don&#39;t think too hard about it.</p><p><strong>Princess Summer Vacation (False): [A]</strong></p><p>Why is there a (False) included even though I&#39;m a princess!?<br> I&#39;m a proper respectable princess though!!<br> Eh? That (False) is for the vacation part?<br> Manuscript? Eh? ...Eh?</p><p><strong>Chiyogami Battalion Commander: [EX]</strong></p><p>By controlling small animals made of origami, she can prepare for volley firing, cover bombing, and bombardment shelling.<br> See? The princess&#39;s battalion makes beautiful geometric patterns, don&#39;t you agree?</p><h2 id="noble-phantasm-s" tabindex="-1"><a class="header-anchor" href="#noble-phantasm-s" aria-hidden="true">#</a> Noble Phantasm(s)</h2><h1 id="hakuro-castle-thousand-forms-mili-mili-night-fever" tabindex="-1"><a class="header-anchor" href="#hakuro-castle-thousand-forms-mili-mili-night-fever" aria-hidden="true">#</a> Hakuro Castle - Thousand Forms Mili-Mili Night Fever</h1><ul><li>Rank: EX</li><li>Classification: Anti-Army (1 Battalion)</li><li>Range: 1~10</li><li>Maximum Number of Targets: 1000 sheets (unit of measure is origami)</li></ul><p>Hakuro Jyou\u30FBSenshiki Mili-Mili Night Fever.<br> A battalion of origami (one thousand sheets) that is fully utilized for volley firing, cover bombing, and main battery shooting.<br> It&#39;s the dazzling climax of the bombing raid. Explode, Explode!<br> By the way, mili-mili is an abbreviation for &quot;Million Military,&quot;<br> though Okki has yet to realize that a thousand (\u5343, Sen) is actually 1000 (\u30B5\u30A6\u30B6\u30F3\u30C9, Sauzando).<br> The protagonist has noticed, however is unable to bring it up to them.</p><h1 id="character" tabindex="-1"><a class="header-anchor" href="#character" aria-hidden="true">#</a> Character</h1><h2 id="pronouns" tabindex="-1"><a class="header-anchor" href="#pronouns" aria-hidden="true">#</a> Pronouns</h2><p>First Person Pronouns: hime (watashi)<br> Second Person Pronouns: anata / anta<br> Third Person Pronouns: kare / kanojo</p><h2 id="personality" tabindex="-1"><a class="header-anchor" href="#personality" aria-hidden="true">#</a> Personality</h2><p>She has become just a bit more active now that her Saint Graph (\u970A\u57FA, Reiki, NA localized as &quot;Spirit Origin&quot;) has changed from Assassin to Archer. To the extent that she has stopped being a shut-in and has immersed herself in survival games[4]. However, the fundamental nature of wanting to play around hasn\u2019t changed. She is just one of those types of people who don\u2019t want to work.</p><h2 id="attitude-towards-master" tabindex="-1"><a class="header-anchor" href="#attitude-towards-master" aria-hidden="true">#</a> Attitude Towards Master</h2><p>Not especially different from when she was an Assassin. The heart of a maiden is complicated and mysterious, searching aimlessly in the dark, and without compassion.</p><h2 id="dialogue-examples" tabindex="-1"><a class="header-anchor" href="#dialogue-examples" aria-hidden="true">#</a> Dialogue Examples</h2><p>&quot;We&#39;ve lost communication! Now that it has come to this, all troops charge! Fire, fire, fire! Alright, bombing raid successful! This is the Princess&#39;s Hakuro Castle - Thousand Forms Mili-Mili Night Fever!&quot;</p><p>&quot;Alright, time to take the offensive! Osakabehime loves Ma-chan, yup! That comes from the very bottom of my heart! Ah, I&#39;m not the type to endure too much, is that what you call rushing recklessly? Anyway, be prepared! Do you understand me, Ma-chan!&quot;</p><h2 id="historical-character-and-figure" tabindex="-1"><a class="header-anchor" href="#historical-character-and-figure" aria-hidden="true">#</a> Historical Character and Figure</h2><p>Comparable to Osakabehime (Assassin).</p><h2 id="character-in-fgo" tabindex="-1"><a class="header-anchor" href="#character-in-fgo" aria-hidden="true">#</a> Character in FGO</h2><p>The first assassin of the 2019 swimsuit event,<br> &quot;Here We Come! Las Vegas Official Bout ~ Tournament of the Seven Swimsuit Blademasters!&quot;.<br> The casino has been remodeled into a survival game zone in order to fully enjoy a rare outdoor summer.</p><p>One of the swimsuit blademasters who protects the casino under the command of the Ruler, the Lion King.<br> \u201CIt can&#39;t be helped since I was ordered to,&quot; she states making excuses for herself as she enjoys the summer.</p><p>Thus naturally, she forgot about the matter of the manuscript.<br> Is that alright? It&#39;s fine. If I progress at a pace of 20 pages a day, I should be able to make it in time... !<br> So the person in question said, but she couldn&#39;t make it in time, so Kiyohime forcibly imprisoned her inside the bell so she could work on the manuscript and just barely meet the deadline.</p><h2 id="standard-weapons" tabindex="-1"><a class="header-anchor" href="#standard-weapons" aria-hidden="true">#</a> Standard Weapons</h2><p>Auto-pistol (toy) / submachine gun (toy) / automatic sniper rifle (toy) / gatling gun (toy)</p><h2 id="related-characters" tabindex="-1"><a class="header-anchor" href="#related-characters" aria-hidden="true">#</a> Related Characters</h2><p><strong>Kiyohi\u30FC</strong></p><p>Somehow they managed to chase me with a flashlight strapped to their head while riding to the theme song of Grave Village.<br> &quot;Ge-n-ko-ma-da-de-su-ka-!&quot;</p><p><strong>Musashi-chan</strong></p><p>Huh? This Musashi-chan, isn&#39;t this by any chance yabai (\u30E4\u30D0\u3044, risky), is something like this really okay? So this is how it turned out.</p><p><strong>Katsushika Hokusai (Swimsuit)</strong></p><p>Stop it! Stop it! You&#39;ll regret it for the rest of your life!<br> The name for the sword!? Four sword style (alt. school of four swords)!? Such a cool and terrifying thing...!</p><p><strong>Jack, Nursery, and other child-like Servants</strong></p><p>Yes yes, what&#39;s the next request? (while folding origami)</p><p><strong>Tomoe Gozen (Swimsuit)</strong></p><p>Bwoom, bwoom.</p><h2 id="comment-from-the-illustrator" tabindex="-1"><a class="header-anchor" href="#comment-from-the-illustrator" aria-hidden="true">#</a> Comment from the Illustrator</h2><p>Takeuchi san suggested &quot;a stylish dark jacket like in a survival game!&quot; I thought for a moment, &quot;Okki...Stylish!?&quot; I&#39;m really glad I didn&#39;t do the pink naked overalls I had pictured in my mind that I was about to submit when I had the chance. It&#39;s no longer a swimsuit anymore. The gun was very difficult to design, resulting in a rather creative design. I somehow managed to submit it, though then got an additional order for a location...gue! At first the origami soldiers were only just frogs, but they ended up accepting everything including the tigers and chickens that I had scribbled in the corners, I can only offer my gratitude for that.... (Daisuke Moriyama)</p><h2 id="tl-notes" tabindex="-1"><a class="header-anchor" href="#tl-notes" aria-hidden="true">#</a> TL Notes</h2><p>[1] NA localization for \u4F1D\u627F (Densh\u014D, Tradition/Folklore) have also used &quot;Legend&quot; and &quot;History&quot; as translations. NA localization of \u9B3C\u795E (Kishin) has in the past used the translation of &quot;Fierce God&quot;.</p><p>[2] The term \u5175\u58EB\u305F\u3061 (Heishi-tachi) is also the japanese name of a four-act opera in German titled Die Soldaten (The Soldiers) by German composer Bernd Alois Zimmermann.</p><p>[3] Jinushigami (\u5730\u4E3B\u795E), also known as jigami (\u5730\u795E), tochigami (\u571F\u5730\u795E), chi no kami (\u5730\u306E\u795E, also read as ji no kami), or jinushisama (\u5730\u4E3B\u69D8), are Shinto folk deities, or kami, of an area of land (the name literally means &quot;land-master-kami&quot;). They were originally associated with new areas of land opened up for settlement.</p><p>[4] \u30B5\u30D0\u30B2\u30FC (Sabag\u0113) short/slang for \u30B5\u30D0\u30A4\u30D0\u30EB\u30B2\u30FC\u30E0, lit. survival game. Wasei-eigo (&quot;Japanese-made English&quot;) used for airsoft games (battle games that use air guns to fire plastic pellets).</p><h2 id="material-images" tabindex="-1"><a class="header-anchor" href="#material-images" aria-hidden="true">#</a> Material Images</h2><p>(Lib will add after publish)</p><h2 id="dialogue" tabindex="-1"><a class="header-anchor" href="#dialogue" aria-hidden="true">#</a> Dialogue</h2><table><thead><tr><th style="text-align:left;">Occassion</th><th style="text-align:center;">English</th><th style="text-align:center;">Japanese</th></tr></thead><tbody><tr><td style="text-align:left;">Summoned</td><td style="text-align:center;"></td><td style="text-align:center;"></td></tr></tbody></table>', 67);
